  \"2016-07-27T22:58:03.143030\",\n\t\"name\": \"a-study-of-pioneer-vegetation-communities-along-a-power-line-clearing-at-the-patuxent-wild\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1960 a strip of forest at the Patuxent
  Wildlife Research Center was clear-cut to establish a high tension power line. Almost
  all vegetation was removed and the topsoil allowed to erode or scraped away. By
  the summer of 1963 communities of pioneer vegetation were evident and the author
  of this report studied their composition and arrangement. The major objectives:
  of the present study were: to delimit the boundaries of all distinct plant communities
  and plot them on a series of maps, to describe the habitat of each community and
  list its identifiable species, and to examine the apparent trends of succession
  along the power line. A fourth objective was to establish specific reference points
  along the line from which photographs and observations could be taken for future
  comparison of the plant cover.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
